import React from 'react';

function FilterYear(props) {
    return (
        <div 
            
            
            style={{
                display: "flex",
                width: "100%",
                height: 50,
                fontSize: 20
            }}
        >
            <b
            
            style={{
                color: 'white'
            }}
            >Filter by year</b>
            <select
                style={{
                    color: 'black',
                    width: 150,
                    borderRadius: 5,
                    right: 0,
                }}
            >
                <option value="">
                    {props.year}
                </option>
            </select>
        </div>
    );
}

export default FilterYear;
